import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faAdd } from "@fortawesome/free-solid-svg-icons";
import React from "react";
import { IconProp } from "@fortawesome/fontawesome-svg-core";

type Menu = {
        name: String;
        icon: IconProp
}


export default function MenuDashboard(menu: Menu){
    return (<>
                      <li className="p-3 mx-4  rounded-lg flex flex-col gap-3 items-center justify-start text-slate-500 relative">
                               <div className="w-full flex flex-row justify-start items-center p-2">
                               <FontAwesomeIcon icon={menu.icon} className="" size="lg" />
                                <span className="pl-3">{menu.name}</span>
                                <FontAwesomeIcon icon={faAdd} className="bg-slate-300 p-1 w-3 h-3 text-slate-700 rounded-full absolute right-0"/>
                               </div>
                                <div className="w-full rounded-es-lg p-2 border-l border-slate-400">
                                    <ul className="flex flex-col justify-start items-start gap-2 text-sm">
                                        <li>Mobile App Task </li>
                                        <li>Lalalaa</li>
                                        <li>Lililil</li>
                                    </ul>
                                </div>
                            </li>

    </>)    
}
